import React, { useState } from 'react';
import './App.css';
import Formlogin from './components/Formlogin';
import { Route, Routes } from "react-router-dom";
import Diary from "./pages/Diary";
import LoginForm from "./components/Formlogin";
import RegisterForm from './components/RegisterForm';
import CustomCarousel from './components/Carousel';
import logo from "./images/logo.webp";

function App() {
  const [showRegisterModal, setShowRegisterModal] = useState(false);

  const handleOpenModal = () => {
    setShowRegisterModal(true);
  };

  const handleCloseModal = () => {
    setShowRegisterModal(false);
  };

  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          element={
            <div className="main-content">
              <div className='logotipo'>
                <img
                  src= { logo }
                  className='pag-logo'
                  alt='Logotpo agendapp'
                />
              </div>
              <div className='login'>
                <Formlogin  
                  message="Ingresa tus credenciales de acceso"
                  email="Correo:"
                  pass="Clave:"
                  login="Ingresar"
                  messageReg="Â¿No tienes cuenta?"
                  register="Registrarse" 
                />
                <button onClick={handleOpenModal} style={{ background: '#008000', color: '#f5f5f5', marginTop: '20px' }}>Registrar</button>
              </div>
              <div className='sect-carousel'>
                <CustomCarousel/>
              </div>
            </div>
          }
        />
        <Route path='/diary' element={<Diary />} />
        <Route path= "/login" Component={LoginForm} />
        <Route path= "/register" Component={<RegisterForm onClose={handleCloseModal} /> } />
      </Routes>
      { showRegisterModal && <RegisterForm onClose={handleCloseModal} />}
    </div>
  );
}

export default App;
